              "reviews" : [
                 {
                    "author_name" : "Cassidy Byrd",
                    "author_url" : "https://www.google.com/maps/contrib/111711797880452354333/reviews",
                    "language" : "en",
                    "profile_photo_url" : "https://lh5.googleusercontent.com/-25_oG7ro7Ic/AAAAAAAAAAI/AAAAAAAAAGI/XMW43weApLg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
                    "rating" : 5,
                    "relative_time_description" : "a month ago",
                    "text" : "Tierra Mia is so good I drive from San Jose to get here. The hands down best vanilla latte, and the horchata latte is dangerously addictive (I had three in two hours). They also offer alternative milks. It's usually busy, so finding a seat is tricky, but if you're coming to study, it's worth the wait. Outlets all around, and their weird pastries are great. Everyone is friendly and amazing.",
                    "time" : 1524087684
                 },
                 {
                    "author_name" : "Elliott Park",
                    "author_url" : "https://www.google.com/maps/contrib/101664298358840051377/reviews",
                    "language" : "en",
                    "profile_photo_url" : "https://lh6.googleusercontent.com/-TMcuTEZt68g/AAAAAAAAAAI/AAAAAAAAAbc/L7lszvuhS6s/s128-c0x00000000-cc-rp-mo/photo.jpg",
                    "rating" : 4,
                    "relative_time_description" : "3 weeks ago",
                    "text" : "Horchata Latte is delicious. Overall vibe and style is great. Could work on the cleanliness a bit. There was a swarm of flies just outside the door that you have to walk through to get in and they get inside. But, if you can handle that, it is great.",
                    "time" : 1525451221
                 },
                 {
                    "author_name" : "Christopher Harris",
                    "author_url" : "https://www.google.com/maps/contrib/106717560997501857177/reviews",
                    "language" : "en",
                    "profile_photo_url" : "https://lh6.googleusercontent.com/-dA5pTT1AI28/AAAAAAAAAAI/AAAAAAAABDQ/_x2TPBkw35c/s128-c0x00000000-cc-rp-mo/photo.jpg",
                    "rating" : 1,
                    "relative_time_description" : "2 months ago",
                    "text" : "I think the concept behind is totally backwards. The coffee is decent but to say terra Mia ( my land ) is for he Hispanic community is ridiculous. From where they get the coffee is maybe $2 Per kilo tops, yet they charge $20 for 12oz at their shops. They also told me because it’s from Long Beach they want to keep the Hispanic culture and community behind it so they’re located in newly developed areas which were once Latino. How many Latino customers from the communities do they have? WHAT ABOUT FAIR TRADE???",
                    "time" : 1520710782
                 },
                 {
                    "author_name" : "Sandeep Singh",
                    "author_url" : "https://www.google.com/maps/contrib/110371970951493322064/reviews",
                    "language" : "en",
                    "profile_photo_url" : "https://lh4.googleusercontent.com/-5o8joC_vj74/AAAAAAAAAAI/AAAAAAAAAEg/50Ttbyri7to/s128-c0x00000000-cc-rp-mo/photo.jpg",
                    "rating" : 5,
                    "relative_time_description" : "a month ago",
                    "text" : "Stopped here for coffee just by chance. It was the best cup of coffee I had ever had. Period. I have made the 20 mile trip just for coffee half a dozen times since. Hope they open up a joint in Walnut Creek.",
                    "time" : 1523128889
                 },
                 {
                    "author_name" : "Rebecca Leah",
                    "author_url" : "https://www.google.com/maps/contrib/109145974557381081868/reviews",
                    "language" : "en",
                    "profile_photo_url" : "https://lh4.googleusercontent.com/-zlJG7bMcpwg/AAAAAAAAAAI/AAAAAAAAAp8/O_Y973hIRyo/s128-c0x00000000-cc-rp-mo/photo.jpg",
                    "rating" : 5,
                    "relative_time_description" : "2 months ago",
                    "text" : "Tierra Mia has good food and coffee and a nice, chill vibe. Lots of students and freelancers there. Not super quiet but not too noisy...in between. Staff are very nice. Right above the 19th St. BART station. Highly recommend.",
                    "time" : 1520560091
                 }
